sys_script_include.script:
var getProperties = Class.create();
getProperties.prototype = {
    initialize: function() {
		var data = {
			"list": []
		};
		//data.list = [];
		var rec = new GlideRecord('x_58872_needit_property');
		rec.query();
		while(rec.next()){
			var prop = {};
			prop.id = rec.number;
			prop.title = rec.title;
			prop.address = rec.address;
			data.list.push(prop);
		}
    },

    type: 'getProperties'


};
